import React from 'react';

const MapSection = () => {
  return (
    <section className="mb-12">
      <h2 className="text-3xl font-bold text-center mb-8 text-blue-800">Our Location</h2>
      <div className="w-full h-96 rounded-xl overflow-hidden shadow-lg">
        <iframe
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3875.317140895187!2d100.501765315083!3d13.756330990346!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x30e29e8b0a0a0a0a%3A0x0a0a0a0a0a0a0a0a!2sBangkok%2C+Thailand!5e0!3m2!1sen!2sus!4v1692000000000!5m2!1sen!2sus"
          width="100%"
          height="100%"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
      <p className="text-center text-gray-600 mt-4">Note: This is an embedded map from Google Maps. Visit: https://maps.app.goo.gl/88sxxqP1YZHFa44h7 for precise location.</p>
    </section>
  );
};

export default MapSection;
